          box-shadow: 0 1px 0 0 rgba(25, 25, 25, 0.4);
  color: #322c2e;
  max-width: 100%;
}

.communication .form-input:focus {
  -webkit-box-shadow: 0 2px 0 0 #14b8eb;
          box-shadow: 0 2px 0 0 #14b8eb;
  color: #14b8eb;
}

@media (min-width: 1600px) {
  .header-tear__bg {
    width: 54%;
    right: -1%;
  }
  .about__heading, .about__description-container {
    padding-left: 1rem !important;
  }
  .about__subheading {
    font-size: 1.625rem;
  }
  .about__subheading::before {
    top: 1.25rem;
  }
  .about__p {
    font-size: 1.25rem;
  }
  .insurance__info {
    font-size: 1rem;
  }
}

@media (min-width: 2561px) {
  .header-tear__bg {
    right: -3%;
  }
  .about__background,
  .our-services__background {
    width: 50vw;
  }
  .about .row,
  .our-services .row {
    left: initial;
    right: 10vw;
    color: black;
    width: 40vw;
  }
  .about__heading,
  .our-services__heading {
    color: #14b8eb;
  }
  .about__subheading::before,
  .our-services__subheading::before {
    content: none;
  }
  .about__subheading, .about__p,
  .our-services__subheading,
  .our-services__p {
    text-shadow: none;
  }
}

@media (max-width: 1440px) {
  .about,
  .our-services {
    position: relative;
    color: white;
  }
  .about__background,
  .our-services__background {
    width: 70%;
    position: static;
    background-size: contain;
  }
  .about .row,
  .our-services .row {
    text-align: center;
    position: static;
    width: 100%;
    left: 0;
    color: black;
  }
  .about__heading,
  .our-services__heading {
    color: #14b8eb;
  }
  .about__subheading,
  .our-services__subheading {
    text-align: justify;
  }
  .about__subheading, .about__p,
  .our-services__subheading,
  .our-services__p {
    text-shadow: none;
  }
  .company-services {
    margin-left: 0;
  }
}

@media (max-width: 1200px) {
  .header-tear {
    right: 0;
  }
  .insurance__info {
    max-width: 480px;
    margin: auto;
  }
  .comp-coop .container-fluid {
    width: 100%;
  }
  .purchase__svg-container .steps__border-dots.svg {
    width: 160%;
  }
}
